const updateStudentGradeByCity = (students, city, newGrades) => {
  return students.filter(student => students.location === city).map(student => {
    const obj = newGrades.find(grade => grade.studentsId === student.id);
    const grade = obj ? obj.grade : 'N/A';
    return {
      ...student,
      grade
    };
  });
};
module.exports = updateStudentGradeByCity;
